Reports empty string operands in string concatenations. Concatenation with the empty string can be used to convert non-`String` objects or primitives into `String`s, but it can be clearer to use a `String.valueOf()` method call.


A quick-fix is suggested to simplify the concatenation.

**Example:**


      void foo(int x, int y) {
        String s = "" + x + " ; " + y;
      }

After the quick-fix is applied:


      void foo(int x, int y) {
        String s = x + " ; " + y;
      }


Use the **Report only where empty strings can be removed without other changes**
option to ignore cases cases where removing the empty string
will require adding a `String.valueOf()` conversion of another operand.

